"MSG_ALL_UNPAID_SENT" => "Visi neapmokėti faksai buvo išsiųsti.",
"MSG_APIACCOUNTCREATION_BODY" => "Thank you for your registration to the PamFax Developer Program. An account has been created so that you can start exploring the rich PamFax API right away.\n\nYou can now log in at the <a href=\"https://sandbox-apifrontend.pamfax.biz\">PamFax API frontend</a> to access the documentation, download sample code and test the API.\n\nYour API credentials are:\nAPI key: {apikey}\nAPI secret word: {apisecret}\n\nPlease note that the sandbox database does not contain any data from the live environment. It is a separate system. The sandbox API does not really sent faxes. Randomly, some of your faxes will fail in the sandbox to let you test the failure case. Most of the faxes will just be reported as successfully sent, although the fax never really was sent.\nThis also applies to PamFax Credit in the sandbox - it's just virtual money. You can add as much PamFax Credit to your PamFax test account using the function Shopping/AddCreditToUser as you want. You can then use the PamFax Credit to test the sending process. We also provide a test fax number so you can test receiving faxes.\n\nWe have created a new PamFax user for you in the production system and sandbox system with PamFax Credit for testing purposes:\nUsername: {username}\nPassword: {password}\n\nOnce you have completed the development, send us an email to devsupport@pamfax.biz with a description of the solution and a few screenshots. We will review your solution and will enable access to the production system. It is a short and uncomplicated process.\n\nNeed help? We've created a <a href=\"https://groups.google.com/d/forum/pamfax-api-partners\">moderated mailing list for all PamFax API developers</a>. For 1:1 support or problems with your PamFax account, just send us an email to <a href=\"mailto:devsupport@pamfax.biz\">devsupport@pamfax.biz</a>",
"MSG_APIACCOUNTCREATION_SUBJECT" => "Jus sveikina „PamFax“ kūrėjų programą",
"MSG_AUTOTOPUP" => "{credit} buvo automatiškai persiųsti iš įmonės {company} vartotojui {username}",
"MSG_BASICPLAN_EXTENDED" => "Dėkojame, kad praplėtėte planą PamFax Basic šiuo fakso numeriu:\n\n<b>{number}</b>\n\n{months} mėnesiams. Šio numerio galiojimas baigsis {expiredate}.",
"MSG_BASICPLAN_PURCHASED" => "Sveikiname, jūsų planas PamFax Basic buvo aktyvuotas kitiems {months} mėnesiams.\n\nJūs netrukus gausite dar vieną žinutę ir/arba el. laišką su jūsų asmeniniu gaunamo fakso numerio, kai jis bus paruoštas gauti faksus. \n\nJūsų privalumai:\n- {months} mėnesių prenumerata\n- Nemokamas ir neribotas fakso gavimas\n- 30 dienų siųstų ir gautų faksų saugojimas\n- Jokių reklamų\n\nPlano galiojimo laikas pasibaigs {expiredate}. Mes perspėsime apie artėjančią pabaigą, kad galėtumėte laiku pratęsti planą ir išsaugoti savo numerį.",
"MSG_BASICPLAN_REFUNDED" => "Jūsų PamFax Basic plano užsakymas {order_id} buvo apmokėtas. Šio plano galiojimo laikas baigiasi {expiredate}",
