"MSG_CREDIT_EXPIRATION_WARNING" => "Jūs nesiuntėte fakso per paskutines {inactivity} dienas. Jūsų abonentui reikia patvirtinimo kas 180 dienų. Atnaujinkite galiojimo laiką nusiuntę faksą per {days_to_expiration} dienas.",
"MSG_CREDIT_EXPIRATION_WARNING_1" => "Jūs nesiuntėte fakso per paskutines 180 dienas. Jūsų sutarties su PamFax galiojimas automatiškai pasibaigs.\n\nJūs turite {days_to_expiration} dienas, kad spėtumėte pratęsti sutartį atlikę vieną iš šių veiksmų:\n1. Nusiųskite dokumentą arba tik fakso viršelį (į galiojantį arba negaliojantį numerį) arba\n2. Nusipirkite PamFax kreditų (spauskite \"Pirkti PamFax kreditų\" PamFax programoje arba nusipirkite kreditų iš mūsų internetinės parduotuvės {website_url}shop).\n\nJūsų sutartis bus pratęsta dar 180 dienų.",
"MSG_CREDIT_EXPIRATION_WARNING_2" => "Atrodo, kad jums dar nėra naudojamas bet kuris iš jūsų kredito PamFax gana ilgai. Jis tampa neaktyvus, jei turite ne jį naudojo 180 dienų iš eilės. Jūs turite {days_to_expiration} dienų paliko prieš jūsų kredito tampa neaktyvus.\n\nKaip jums išlaikyti jūsų balansas yra aktyvus? Tai paprasta. Atlikite vieną iš šių ir jūsų PamFax Kredito likutis bus aktyvus dar 180 dienų:\n\n- Siųsti dokumentą arba titulinio puslapio faksas (galiojantį arba nepagrįstais)\n- Pirkimo PamFax kreditų paketą ar planas iš mūsų parduotuvėje {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_3" => "Jūsų sutarties galiojimas pasibaigs po 48 valandų.\n\nTai yra jūsų paskutinis šansas, pratęskite sutartį! \n\nAtlikite vieną iš šių veiksmų:\n1. Nusiųskite dokumentą arba tik fakso viršelį (į galiojantį arba negaliojantį numerį) arba\n2. Nusipirkite PamFax kreditų (spauskite \"Pirkti PamFax kreditų\" PamFax programoje arba nusipirkite kreditų iš mūsų internetinės parduotuvės {website_url}shop).\n\nJūsų sutartis bus pratęsta dar 180 dienų.\n\nJei nesureaguosite per 48 valandas, jūsų sutartis bus nutraukta.",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_1" => "Atrodo, kad jums dar nėra naudojamas bet kuris iš jūsų kredito PamFax gana ilgai. Jis tampa neaktyvus, jei turite ne jį naudojo 180 dienų iš eilės. Jūs turite {days_to_expiration} dienų paliko prieš jūsų kredito tampa neaktyvus.\n\nKaip jums išlaikyti jūsų balansas yra aktyvus? Tai paprasta. Atlikite vieną iš šių ir jūsų PamFax Kredito likutis bus aktyvus dar 180 dienų:\n\n- Siųsti dokumentą arba titulinio puslapio faksas (galiojantį arba nepagrįstais)\n- Pirkimo PamFax kreditų paketą ar planas iš mūsų parduotuvėje {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_2" => "Atrodo, kad jums dar nėra naudojamas bet kuris iš jūsų kredito PamFax gana ilgai. Jis tampa neaktyvus, jei turite ne jį naudojo 180 dienų iš eilės. Jūs turite {days_to_expiration} dienų paliko prieš jūsų kredito tampa neaktyvus.\n\nKaip jums išlaikyti jūsų balansas yra aktyvus? Tai paprasta. Atlikite vieną iš šių ir jūsų PamFax Kredito likutis bus aktyvus dar 180 dienų:\n\n- Siųsti dokumentą arba titulinio puslapio faksas (galiojantį arba nepagrįstais)\n- Pirkimo PamFax kreditų paketą ar planas iš mūsų parduotuvėje {shop_url}",
"MSG_CREDIT_EXPIRATION_WARNING_EMAIL_3" => "Jūsų sutarties galiojimas pasibaigs po 48 valandų.\n\nTai yra jūsų paskutinis šansas, pratęskite sutartį! \n\nAtlikite vieną iš šių veiksmų:\n1. Nusiųskite dokumentą arba tik fakso viršelį (į galiojantį arba negaliojantį numerį) arba\n2. Nusipirkite PamFax kreditų (spauskite \"Pirkti PamFax kreditų\" PamFax programoje arba nusipirkite kreditų iš mūsų internetinės parduotuvės {website_url}shop).\n\nJūsų sutartis bus pratęsta dar 180 dienų.\n\nJei nesureaguosite per 48 valandas, jūsų sutartis bus nutraukta.",
"MSG_CREDIT_EXPIRATION_WARNING_MAIL_BODY" => "Panašu, kad kažkurį laiką nenaudojote PamFax abonento. Jūsų abonento galiojimo laikas pasibaigs, jei nenaudosite PamFax 180 dienų (peržiūrėkite PamFax naudojimosi sąlygas, su kuriomis sutikote įdiegdami PamFax: {website_url}terms). Jūs turite {days_to_expiration} dienas, kad patvirtintumėte abonentą, kad jis vėl taptų aktyvus.\n\nJūsų abonento duomenys:\n\nPamFax vardas: {username}\nLikutis: {credit}\n\n\n=== Kokios yra PamFax kreditų galiojimo pasibaigimo taisyklės? ===\n\n1. Jūsų abonento galiojimo laikas pasibaigia, jei nenaudojate jį 180 dienų.\n2. Kiekvienas išsiųstas faksas (nesvarbu koks rezultatas), pratęs galiojimą dar 180 dienų.\n3. Mes nenorime, kad jūs prarastumėte savo abonento, todėl siunčiame šį priminimą likus 30 dienų iki abonento galiojimo laikas pasibaigs. \n\n=== Kaip išlaikyti PamFax abonentą aktyvų? ===\n\nPaprasčiausiai atlikite vieną iš tolimesnių ir jūsų PamFax abonentas bus aktyvuotas dar 180 dienų:\n\n1. Nusiųskite dokumentą arba fakso viršelį arba \n2. Nusipirkite PamFax kreditų (spauskite \"Pirkti PamFax kreditų\" PamFax programoje arba nusipirkite kreditų internetinėje parduotuvėje {website_url}shop).\n\nSavo abonento duomenis ir ankstesnius pirkimus galite peržiūrėti čia: {portal_url}\n\n{email_footer}\n\n<p style='font-family: verdana, arial, helvetica, sans-serif; font-size: 10pt'>\n== Gauti PamFax pagalbos ==\n\nKadangi negalite atsakyti tiesiogiai el. paštu, galite susisiekti su mumis per pagalbos centrą {website_url}support . Jūs taip pat galite aplankyti mūsų forumus {website_url}forum .\n\n========================= SAUGOKITE SAVO SLAPTAŽODĮ ========================\n\nPamConsult GmbH NIEKADA neprašys jūsų slaptažodžio el. paštu. Vienintelė vieta, kur jums reikia įrašyti slaptažodį yra kai jūs prisijungiate prie PamFax arba internetinėje svetainėje, kai norite ką nors nusipirkti arba peržiūrėti abonentą. Jūs visada prisijungsite prie PamFax portalo per saugų ryšį ir mes prašome užtikrinti, kad adresas naršyklėje visada prasideda su {portal_url}. Taip pat turi būti parodyta nedidelė spyna, kuri parodo, kad ryšys yra saugus.",
"MSG_CREDIT_EXPIRATION_WARNING_MAIL_SUBJ" => "Jūsų PamFax kreditų galiojimas tuoj pasibaigs",
"MSG_CREDIT_NOTIFICATION" => "Jūsų abonente liko tik {user_credit} PamFax kreditų. Pridėkite PamFax kreditų į savo abonentą, kad galėtumėte siųsti faksus.\n\nTiesiog pridėkite PamFax kreditų čia: {shop_link1}",
"MSG_CREDIT_NOTIFICATION_EMAIL" => "Siunčiame jums šį laišką, nes norime priminti, kad PamFax kreditų mažėja (tik {user_credit} likę). \n\nDabar yra puikus metas pridėti PamFax kreditų į jūsų abonentą, kad galėtumėte siųsti faksus. <a href=\"{shoplink1}\">Pridėti PamFax kreditų</a>.",
