"MSG_EMAIL_NOP_BODY" => "Pastebėjome, kad bandėte užsisakyti {product} iš mūsų internetinės parduotuvės.\n\nDeja, bet jūsų užsakymas nebuvo užbaigtas ir mes norime paklausti kodėl. Jei jūs užsisakėte dar kartą, ignoruokite šią žinutę.\n\nMes norime sužinoti, kodėl jūsų užsakymas nebuvo užbaigtas. Prašome užpildyti <a href=\"http://surveys.polldaddy.com/s/57625E11D7DDF990/\">penkių trumpų klausimų anketą</a>.\n\nJei jūs neužsisakėte, bet norėtumėte tai padaryti dabar, tai padaryti galite <a href=\"{shop product link}\">čia</a>.",
