"MSG_PLAN_EXPIRATION_WARNING_3" => "Jūsų PamFax plano su asmeniniu fakso numeriu {number} galiojimas baigsis po 48 valandų. Tai yra paskutinis pranešimas iš mūsų!\n\nKad pratęstumėte PamFax planą (ir išsaugotumėte savo asmeninį fakso numerį), sekite šiuos paprastus veiksmus:\n\n1. Eikite į PamFax parduotuvę: {shop_url_plans}\n2. Prisijunkite su PamFax vartotojo vardu {username}\n3. Pirkimo puslapyje, ten kur įrašote savo adresą, pasirinkite \"Pratęsti turimo fakso numerio galiojimą\"\n4. Užbaikite apmokėjimą. Po sėkmingo apmokėjimo, jūsų fakso plano galiojimas bus pratęstas\n\nSavo numerį ({number}) galėsite naudoti dar 12 mėnesiu neribotam fakso gavimui.\n\nJei nesiimsite jokių veiksmų per 48 valandas, jūsų asmeninis fakso numeris ({number}) bus ištrintas visiškai.",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_1" => "Jūsų asmeninio fakso numerio <b>{number}</b> galiojimas <b>baigsis po {days_to_expiration}</b> dienų ({expiration_date}). \n\nKad pratęstumėte PamFax planą (ir išsaugotumėte savo asmeninį fakso numerį), sekite šiuos paprastus veiksmus:\n\n1. Eikite į PamFax parduotuvę: {shop_url_plans}\n2. Prisijunkite su PamFax vartotojo vardu {username}\n3. Pirkimo puslapyje, ten kur įrašote savo adresą, pasirinkite \"Pratęsti turimo fakso numerio galiojimą\"\n4. Užbaikite apmokėjimą. Po sėkmingo apmokėjimo, jūsų fakso plano galiojimas bus pratęstas\n\nSavo numerį ({number}) galėsite naudoti dar 12 mėnesiu neribotam fakso gavimui.\n\nMes jums priminsime dar kartą likus 7 dienoms iki galiojimo pabaigos.",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_2" => "Jūsų asmeninio fakso numerio <b>{number}</b> galiojimas <b>baigsis po {days_to_expiration}</b> dienų ({expiration_date}). \n\nKad pratęstumėte PamFax planą (ir išsaugotumėte savo asmeninį fakso numerį), sekite šiuos paprastus veiksmus:\n\n1. Eikite į PamFax parduotuvę: {shop_url_plans}\n2. Prisijunkite su PamFax vartotojo vardu {username}\n3. Pirkimo puslapyje, ten kur įrašote savo adresą, pasirinkite \"Pratęsti turimo fakso numerio galiojimą\"\n4. Užbaikite apmokėjimą. Po sėkmingo apmokėjimo, jūsų fakso plano galiojimas bus pratęstas\n\nSavo numerį ({number}) galėsite naudoti dar 12 mėnesiu neribotam fakso gavimui.",
"MSG_PLAN_EXPIRATION_WARNING_EMAIL_3" => "Jūsų PamFax plano su asmeniniu fakso numeriu <b>{number}</b> galiojimas <b>baigsis po 48 valandų</b>. Tai yra <b>paskutinis pranešimas</b> iš mūsų!\n\nKad pratęstumėte PamFax planą (ir išsaugotumėte savo asmeninį fakso numerį), sekite šiuos paprastus veiksmus:\n\n1. Eikite į PamFax parduotuvę: {shop_url_plans}\n2. Prisijunkite su PamFax vartotojo vardu {username}\n3. Pirkimo puslapyje, ten kur įrašote savo adresą, pasirinkite \"Pratęsti turimo fakso numerio galiojimą\"\n4. Užbaikite apmokėjimą. Po sėkmingo apmokėjimo, jūsų fakso plano galiojimas bus pratęstas\n\nSavo numerį ({number}) galėsite naudoti dar 12 mėnesiu neribotam fakso gavimui.\n\nJei nesiimsite jokių veiksmų per 48 valandas, jūsų <b>asmeninis fakso numeris ({number}) bus ištrintas visiškai</b>.",
