"MSG_WELCOME_FAX" => "Hello,\n<br><br>\nThank you for installing PamFax.\nWe’ve sent you this first fax to show you that your fax number works. You are now ready to start sending and receiving faxes with PamFax.\nDid you know that PamFax offers you the following benefits?\n<ol>\n<li>Available for Microsoft Windows, Mac OS X, Android and iPhone/iPad</li>\n<li>Easy fax sending from Outlook 2007/2010 included in PamFax for Windows</li>\n<li>Access Dropbox, Google Drive, OneDrive and Box</li>\n<li>Send faxes worldwide at attractive rates</li>\n<li>Pay as you go with pre-paid credit packs</li>\n<li>Your PamFax credit never expires</li>\n<li>All information is encrypted end to end. Your documents are safe</li>\n</ol><br>\nEarn additional free fax pages by recommending PamFax to your friends. For every recommended person who signs up we will automatically add a free fax page to your account. The recommend function can be accessed from the PamFax application after sending a fax or from the PamFax Portal. The more you recommend the more free pages you get!\nWe hope you like our service. Should you have any questions do not hesitate to contact us via the Support option on the PamFax website at www.pamfax.biz or send us an email to support@pamfax.biz.\n<br>\nBest Regards,<br>\nThe PamFax Team @ PamConsult",
